import styled from "styled-components";

const StyledHeader = styled.div`
  font-size: 24px;
  display: flex;
  justify-content: center;
  flex-direction: column;
  line-height: 29px;
  color: #ffffff;
  margin: 8px;
`;

export default StyledHeader;
